import styled from "styled-components";

export const Container = styled.div`
  padding: 0px 30px;
  display: flex;
  justify-content: center;
  align-items: center;

  border-radius: 20px;
  background: #629bc4;
  margin: 10px;
`;

export const Label = styled.p`
  color: #111;
  font-weight: bold;
`;
